import React from "react";
import FavouritesList from "./FavouritesList.js";
import PlayFilters from "./PlayFilters.js";
import PlayMatches from "./PlayMatches.js";
import "./css/PlayList.css";

const PlayList = (props) => {
    return (
        <div className="container play-list">
            <FavouritesList favourites={props.favourites} removeFromFavourites={props.removeFromFavourites}/>
            <PlayFilters filters={props.filters} setFilters={props.setFilters} setFilteredPlays={props.setFilteredPlays} genres={props.genres}/>
            <PlayMatches plays={props.plays} setFilteredPlays={props.setFilteredPlays} addToFavourites={props.addToFavourites} setCurrentPlay={props.setCurrentPlay}/>
        </div>
    );
};

export default PlayList
